import React from 'react';
import {BrowserRouter, Route} from "react-router-dom";
import './App.css';
import HomePage from "./pages/homepage/homepage.component";

const HasePage= ()=>(
    <div>Hase Page</div>
)

function App() {
  return (
    <div>
      <Route  path={`/`} component={HomePage}/>
      <Route  path={`/haseshop/hats`} component={HasePage}/>
    </div>
  );
}

export default App;
